Release Title: Top.Boy.[2011]HDTV(BINGOWINGZ.UKB-RG)
Release / TV Air Date: 2011
Genre: Thriller
RunTime: 50 Minutes x4
Number Of Episodes: 4

Gang crime, manipulation, boredom... behind
every crime there's a personal story.
This four-part drama, due to air on Channel 4
in autumn 2011, delves into the lives of
young Londoners living on the edge.

Outcasts' Ashley Walters takes the lead as
drug dealer and gang leader
